function rcoord () {
  return {
    lat: Math.random() * 50,
    lng: Math.random() * 150
  }
}

const old = require('./')
const coords = []

for (let i = 0; i < 100; i++) {
  coords.push(rcoord())
}

let sum = 0
for (let i = 0; i < 1e8; ++i) {
  const a = coords[i % 33]
  const b = coords[i % 100]
  sum += old(a, b)
}
console.log(sum)
